import "./Header.css";

function Header() {
    return (
        <div className="section">
            <div className="section1">
                <div className="img-slider">
                    <img src="Images/ales-nesetril-Im7lZjxeLhg-unsplash.jpg" alt="" className="img" />
                    <p>Buy Your Dream Laptop</p>
                </div>
            </div>
        </div>
           );
}

export default Header;
